src/contracts/projects/C2CProject.sol.content:
// SPDX-License-Identifier: LGPL-3.0
pragma solidity 0.8.20;

import "../../interfaces/IC2CProject.sol";
import "../../libraries/abstractProject.sol";

contract C2CProject is AbstractProject, IC2CProject {
    using EnumerableSet for EnumerableSet.AddressSet;

    constructor(string memory _name) AbstractProject(_name) {}

    // #region ***** Variables *********//

    bytes4 public constant IID_RAHAT_PROJECT = type(IRahatProject).interfaceId;

    mapping(address => bool) public isDonor;

    // #endregion

    // #region ***** Token Functions *********//
    function acceptToken(
        address _from,
        address _tokenAddress,
        uint256 _amount
    ) public {
        isDonor[_from] = true;
        _acceptToken(_tokenAddress, _from, _amount);
    }

    function withdrawToken(
        address _tokenAddress,
        address _withdrawAddress
    ) public {
        uint256 _balance = IERC20(_tokenAddress).balanceOf(address(this));
        _withdrawToken(_tokenAddress, _balance, _withdrawAddress);
    }

    // #endregion

    // #region ***** Beneficiaries Functions *********//

    function addBeneficiary(address _beneficiary) public {
        _addBeneficiary(_beneficiary);
    }

    function removeBeneficiary(address _beneficiary) public {
        _removeBeneficiary(_beneficiary);
    }

    function disburseProjectToken(
        address _tokenAddress,
        address _beneficiary,
        uint256 _amount
    ) public {
        addBeneficiary(_beneficiary);
        require(
            IERC20(_tokenAddress).balanceOf(address(this)) >= _amount,
            "Not enough balance"
        );

        require(
            IERC20(_tokenAddress).transfer(_beneficiary, _amount),
            "Transfer Failed"
        );
        emit TransferProcessed(
            _tokenAddress,
            _beneficiary,
            address(this),
            _amount
        );
    }

    function disburseOwnedToken(
        address _tokenAddress,
        address _beneficiary,
        uint256 _amount
    ) public {
        addBeneficiary(_beneficiary);
        require(
            IERC20(_tokenAddress).transferFrom(
                msg.sender,
                _beneficiary,
                _amount
            ),
            "Transfer Failed"
        );
        emit TransferProcessed(
            _tokenAddress,
            _beneficiary,
            msg.sender,
            _amount
        );
    }

    function disburseExternalToken(
        address _tokenAddress,
        address _beneficiary,
        address _tokenOwner,
        uint256 _amount
    ) public {
        addBeneficiary(_beneficiary);
        require(
            IERC20(_tokenAddress).transferFrom(
                _tokenOwner,
                _beneficiary,
                _amount
            ),
            "Transfer Failed"
        );
        emit TransferProcessed(
            _tokenAddress,
            _beneficiary,
            _tokenOwner,
            _amount
        );
    }

    // #endregion

    function supportsInterface(
        bytes4 interfaceId
    ) public view virtual override returns (bool) {
        return interfaceId == IID_RAHAT_PROJECT;
    }
}

src/contracts/RahatDonor.sol.content:
//SPDX-License-Identifier: LGPL-3.0
pragma solidity 0.8.20;

import "@openzeppelin/contracts/utils/introspection/ERC165.sol";
import "./RahatToken.sol";
import "../libraries/abstractTokenActions.sol";
import "../interfaces/IRahatProject.sol";
import "../interfaces/IRahatDonor.sol";

/// @title Donor contract to create tokens
/// @author Rumsan Associates
/// @notice You can use this contract to manage Rahat tokens and projects
/// @dev All function calls are only executed by contract owner
contract RahatDonor is AbstractTokenActions, ERC165 {
    event TokenCreated(address indexed tokenAddress);
    event TokenMintedAndApproved(
        address indexed tokenAddress,
        address indexed approveAddress,
        uint256 amount
    );

    /// @notice All the supply is allocated to this contract
    /// @dev deploys AidToken and Rahat contract by sending supply to this contract

    bytes4 public constant IID_RAHAT_DONOR = type(IRahatDonor).interfaceId;

    mapping(address => bool) public _registeredProject;

    constructor(address _admin) {
        _addOwner(_admin);
    }

    //#region Token function
    function createToken(
        string memory _name,
        string memory _symbol,
        uint8 decimals
    ) public OnlyOwner returns (address) {
        RahatToken _token = new RahatToken(
            _name,
            _symbol,
            address(this),
            decimals
        );
        address _tokenAddress = address(_token);
        emit TokenCreated(_tokenAddress);
        return _tokenAddress;
    }

    function mintToken(address _token, uint256 _amount) public OnlyOwner {
        RahatToken(_token).mint(address(this), _amount);
    }

    function mintTokenAndApprove(
        address _token,
        address _approveAddress,
        uint256 _amount,
        address _projectAddress
    ) public OnlyOwner {
        require(_token != address(0), "token address cannot be zero");
        require(
            _approveAddress != address(0),
            "approve address cannot be zero"
        );
        require(
            _projectAddress != address(0),
            "approve address cannot be zero"
        );
        require(_registeredProject[_projectAddress], "project not registered");

        require(_amount > 0, "amount cannot be zero");

        RahatToken token = RahatToken(_token);
        token.mint(address(this), _amount);
        token.approve(_approveAddress, _amount);
        emit TokenMintedAndApproved(_token, _approveAddress, _amount);
    }

    function addTokenOwner(
        address _token,
        address _ownerAddress
    ) public OnlyOwner {
        RahatToken(_token).addOwner(_ownerAddress);
    }

    function registerProject(address _projectAddress, bool status) public {
        _registeredProject[_projectAddress] = status;
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view virtual override returns (bool) {
        return
            interfaceId == IID_RAHAT_DONOR ||
            super.supportsInterface(interfaceId);
    }

    //#endregion
}

